 art from the Tribeca show, so if there's anything you've been looking at, today's the day! This brand new piece by @chrisrwk features his patent robot characters over a vintage magazine ad and measures in at 6.5‚Ä≥ x 7.25‚Ä≥ entitled ‚ÄúWhats Worth What‚Äù part of a series of 18 paintings on wood panels, done August 2020. Last chance to purchase via Queensartcollective.com (üëâ Link in Bio üëà) to add this piece to your collection!¬†

CHRIS RWK: A child of the 80s, Chris‚Äô world was often completely flooded with the imagery & ideas presented by television, comic books and the music and movies of the time. Immersed in these various mediums, Chris began to store the images brought forward though these everyday experiences in¬† what he refers to as a ‚Äúmental journal‚Äù.¬† This journal was a haven of his thoughts that he could refer back to whenever necessary. His paintings frequently cite past conceptions of popular culture embedded in his psyche‚Äôs cache.

Chris‚Äô works frequently reveal everyday musings and people one would pass on the street without looking or thinking about twice. These images also aid him in the creation of a visual language comprised of his own iconographic imagery. Through the repetition of this imagery, he strives to familiarize his viewers with the language that he has constructed. Chris believes that the notions within his pieces serve as a backbone to the many stories created by the onlooker when they are viewing the work. In 2001, Chris founded Robots Will Kill, an arts site dedicated to community & exposure for artists/media often disregarded by the mainstream art world. #chrisrwk #sacsix #easyandjoz #groupshow #artforsale #newyorkcity #tribeca #urbanart #mural #streetart #nyc #painting #nycstreetart #art #wheatpaste #pasteups #gallery #tags #queens #artshow #streetartnyc #graffitiart #nycart #graffiti #stickers #pasteup #nycgraffiti #228s #popupshop #robotswillkill";}i:108;a:1:{s:14:"comments_count";i:0;}i:109;a:1:{s:11:"likes_count";i:4;}i:110;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu1zSNp_mY";}i:111;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118811769_955466381632164_6544578823518226543_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=CLOwuWfkmekAX9T5A9y&oh=fae59e6c9ea7e7b97ab9af5dd3baa0b3&oe=5F7B0CFC";}i:112;a:1:{s:4:"type";s:5:"image";}i:113;a:1:{s:8:"owner_id";i:6048672461;}i:114;a:1:{s:14:"owner_username";s:0:"";}i:115;a:1:{s:14:"owner_fullname";s:0:"";}i:116;a:1:{s:9:"owner_pic";s:0:"";}i:117;a:1:{s:2:"id";s:19:"2391084834381188789";}i:118;a:1:{s:10:"short_code";s:11:"CEu1v0FHU61";}i:119;a:1:{s:12:"created_time";i:1599259546;}i:120;a:1:{s:7:"caption";s:689:"@ELAGUACARTE proudly presents a photo by @unsplash 

