Bucks County native Seven Strikes always dreamed of making a splash in the art world and those dreams materialized when he started as a tattoo artist at the young age of 20. The owner of Seven Strike Studios is living the American dream. Seven came to the States from the Ukraine at the age of nine. His journey didn't stop there. A lover of arts, theater, dance, and performance, helped shape this entrepreneur into the man he is today. Shortly after opening a tattoo studio in the heart of Bucks County, Seven also created a workplace and a studio for his blossoming fine arts career. Drawn early to urban art, graffiti, and graphic design, Seven honed his skills learned on the streets painting murals into the beautiful gesso canvas works he creates for gallery exhibitions today. Seven's talents don't stop there, he recently has dove head first into the modeling industry and has scored early success in magazine and print. This passion driven artist enjoys channeling his energy into endurance cycling, fire breathing, dance and performance art as well. Seven's original paintings can be found on permanent display at our South State Street gallery.

